import React from 'react';
import axios from 'axios';
import { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { Navbar, Nav, NavDropdown } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css'; // Asegúrate de importar los estilos de Bootstrap
import logo from './path/to/logo'; // Ajusta esta ruta a la ubicación de tu logo
import fotoUsuario from './path/to/fotoUsuario'; // Ajusta esta ruta a la ubicación de la foto del usuario

function NavbarPersonalizado(props) {
  return (
    <Navbar expand="lg" style={{background: '#bb5751'}}>
      <Navbar.Brand className='ms-3'>
        <img alt="logo aplicacion" src={logo} className='navbar-logo'/>
      </Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav" className='navbar-collapse'>
        <Nav className="me-auto">
          <Nav.Link href="/inicio" className='navbar-link'>Inicio</Nav.Link>
          <Nav.Link href="/cuentas" className='navbar-link'>Cuentas</Nav.Link>
          <Nav.Link href="/graficos" className='navbar-link'>Gráficos</Nav.Link>
          <Nav.Link href="/notificaciones" className='navbar-link'>Notificaciones</Nav.Link>
          <Nav.Link href="/sugerencias" className='navbar-link'>Sugerencias</Nav.Link>
        </Nav>
        <Nav>
          <span className="navbar-text me-3">{props.email}</span>
          <NavDropdown drop='start' className='me-3' title={<img src={fotoUsuario} style={{ width: '6vh', borderRadius: '20%' }} alt="icono usuario"/>} id="basic-nav-dropdown">
            <NavDropdown.Item href="/perfil">Mi perfil</NavDropdown.Item>
            <NavDropdown.Divider />
            <NavDropdown.Item href="/">Cerrar sesión</NavDropdown.Item>
          </NavDropdown>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
}

export default NavbarPersonalizado;
